import React from 'react';

const Iframe = ({ source }) => {

    if (!source) {
        return <div>Loading...</div>;
    }

    const src = source;
    return (

        <div>
            <div>
                <iframe src="https://bengarlock.com:6323/"></iframe>
            </div>
        </div>
    );
};

export default Iframe;
